let dp = []
let max = 0
for(let i=0; i < short.length; i++) {
    for(let j=0; j <= i; j++) {
        let str = short.slice(j, i+1)
        if(long.indexOf(str) > -1) {
            dp[i] = Math.max(str.length, dp[i] || 0)
            max = Math.max(max, dp[i] || 0)	
        }
    }
}
