var lastRemaining = function(n, m) {
    // \u8FED\u4EE3 f(n) = [f(n-1) + m] % n
    // i <= n \u7684\u89E3\u91CA\uFF1A\u4E24\u4E2A\u4EBA\u5C31\u8981\u901A\u8FC7\u8FED\u4EE3\u6765\u627E,\u9700\u8981\u53C2\u4E0E\u5FAA\u73AF
    let now = 0
    for(let i=2; i <= n; i++) {
        now = (now + m ) % i
    }
    return now
};
