var findContinuousSequence = function(target) {
    let l=1
    let r=2
    let sum = 3
    let res=[]
    // \u6ED1\u52A8\u7A97\u53E3\u6846\u67B6
    while(l<r){
        if(sum===target){
            let ans =[]
            for(let k=l;k<=r;k++){
                ans[k-l]=k
            }
            res.push(ans)
            // \u7B49\u4E8E\u7684\u60C5\u51B5 \u6211\u4EEC\u53EF\u4EE5\u7EE7\u7EED\u7A97\u53E3\u5F80\u53F3\u641C\u7D22 \u540C\u65F6\u7F29\u5C0F\u5DE6\u8FB9\u7684
             sum=sum-l
             l++
        } else if(sum>target){
            // \u5927\u4E8E\u7684\u6761\u4EF6 \u7F29\u5C0F\u7A97\u53E3 sum\u5DF2\u7ECF\u52A0\u8FC7\u4E86
            sum=sum-l
            l++
        } else {
            // \u5C0F\u4E8E\u7684\u60C5\u51B5 \u6ED1\u52A8\u7A97\u53E3\u7EE7\u7EED\u6269\u5927
            r++
            sum=sum+r
        }
    }
    return res
};
